var parameters = [
	{'parameter':'identifier','value':input.getProperty('identifier')}
];
var config = {
	'accept-type': 'application/json+fhir',
	'relative-url': '/Patient',
	'parameters': parameters
};
var getResponse = client.get(config);
var response = json_parse(getResponse.response);

var result;
//If only 1 response
if (response && response.entry && response.entry.length >= 1) {
	//Parse out the id
	var entry = response.entry[0];
	var id = entry.id.substr(entry.id.lastIndexOf('/')+1);
	//Perform a put with this id
	config = {
		'accept-type': 'application/xml+fhir',
		'relative-url': '/Patient/'+id
	};
	result = client.put(config, input.text);
	output.setProperty("operation", "put");
} else {
	//Do a post
	config = {
		'accept-type': 'application/xml+fhir',
		'relative-url': '/Patient'
	};
	result = client.post(config, input.text);
	output.setProperty("operation", "post");
}

output.setProperty('statusCode', result.status);
output.setText(result.response, 'UTF8');

